import React from 'react'
import Nav from './navbar'
const center = {
    "text-align":"center",
    "background-color" : "lightblue"
};
export default class About extends React.Component{
    render(){
        return(
            <div>
                <Nav>
                <h1 style = {center}>RIP Tongchai Butchart</h1>
                </Nav>
            </div>
        )
    }
}
